message:
O historiador Thomas Giulliano aponta o papel crucial e o heroísmo dos jesuítas em sua atuação em solo brasileiro na série “Brasil — A Última Cruzada”. Mas, quem eram os jesuítas?‍

Dentre os principais feitos da Companhia de Jesus estão:

- a primeira gramática da língua tupi;

- a educação intelectual e religiosa dos índios brasileiros;

- proteção dos índios contra violências e tentativas de escravização;

- propagação da religião cristã e da alta cultura ocidental por todos os continentes do planeta.

▶️ Toque no link para saber quem foram os jesuítas e quais foram suas principais ações no Brasil: https://sitebp.la/artigo-jesuitas

